import React from 'react';
import {Link} from 'react-router-dom';
import GoogleAuth from './GoogleAuth';

const Header = () =>{
    return(
        <div className="ui secondary menu">
            <Link to="/" className="item">
                Twitch
            </Link>
            <div className="right menu">
                <Link to="/" className="item">
                    All streams
                </Link>
                <GoogleAuth/>
            </div>
        </div>
    );
};

export default Header;
